import React, { useState, useEffect } from "react";

export default function Videos({ videos }) {
  return (
    <div>
      {videos &&
        videos.map((v) => {
          return (
            <iframe width="300" controls src={v.uri}>
            </iframe>
          );
        })}
    </div>
  );
}
